import React from 'react';
import { Parallax, Background } from 'react-parallax';
import img from './photo.jpg';

const Temp = () => (
    <div>
        {/* -----basic config-----*/}
        <Parallax
            blur={0}
            bgImage={img}
            bgImageAlt="the cat"
            strength={200}
        >
            <p></p>Put some text content here - even an empty div with fixed dimensions to have a height
            for the parallax.
            <div style={{ height: '800px' }} />
        </Parallax>
    </ div>        
)

export default Temp;
